import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Projects, ContactUs, Footer, Courses, Header, About, Services } from './container';
import { Navbar } from './components';
import ProjectPage1 from './pages/Projectpage1.jsx';
import ProjectPage2 from './pages/Projectpage2.jsx';
import ProjectPage3 from './pages/Projectpage3.jsx';

import './App.css';

const App = () => (
  <Router>
    <Navbar />
    <Routes>
      {/* Home Page */}
      <Route
        path="/"
        element={
          <>
            <Header />
            <About />
            <Projects />
            <Courses />

            <ContactUs />
            <Footer />
          </>
        }
      />

      {/* Individual Project Pages */}
      <Route path="/projectpage1" element={<ProjectPage1 />} />
      <Route path="/projectpage2" element={<ProjectPage2 />} />
      <Route path="/projectpage3" element={<ProjectPage3 />} />

      {/* PropertyView Page */}
      <Route path="/projectpage1" element={<ProjectPage1/>} />

      {/* ContactUs Page */}
      <Route path="/contactus" element={<ContactUs />} />
    </Routes>

  </Router>
);

export default App;
